import React from 'react';
import './Skills.css';

const Skills = ({ skills }) => {
  const skillCategories = [
    { title: 'Lenguajes de Programaci√≥n', skills: skills.programming, icon: 'üíª' },
    { title: 'Frontend', skills: skills.frontend, icon: 'üé®' },
    { title: 'Backend', skills: skills.backend, icon: '‚öôÔ∏è' },
    { title: 'Bases de Datos', skills: skills.databases, icon: 'üóÑÔ∏è' },
    { title: 'Herramientas', skills: skills.tools, icon: 'üõ†Ô∏è' },
    { title: 'Idiomas', skills: skills.languages, icon: 'üåç' }
  ];

  return (
    <section className="skills">
      <div className="container">
        <h2 className="section-title">Habilidades T√©cnicas</h2>
        <div className="skills-grid">
          {skillCategories.map((category, index) => (
            <div key={index} className="skill-category">
              <div className="category-header">
                <span className="category-icon">{category.icon}</span>
                <h3 className="category-title">{category.title}</h3>
              </div>
              <div className="skills-list">
                {category.skills.map((skill, skillIndex) => (
                  <div key={skillIndex} className="skill-item">
                    <span className="skill-name">{skill}</span>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Skills;
